import { Component, OnDestroy } from '@angular/core';
import { CoreConstants } from '@/core/constants';
import { CoreLocalNotifications } from '@services/local-notifications';
import { Device, Translate, NgZone } from '@singletons';
import { CoreLang } from '@services/lang';
import { CoreFile } from '@services/file';
import { CoreSites } from '@services/sites';
import { CoreUtils } from '@services/utils/utils';
import { Subscription } from 'rxjs';
import { CorePushNotifications } from '@features/pushnotifications/services/pushnotifications';
import { CoreConfig } from '@services/config';
import { CoreDomUtils } from '@services/utils/dom';
import { CoreNavigator } from '@services/navigator';
import { CorePlatform } from '@services/platform';
import { CoreNetwork } from '@services/network';
import { CoreLoginHelper } from '@features/login/services/login-helper';
import { CoreSitesFactory } from '@services/sites-factory';

/**
 * Device Info to be shown and copied to clipboard.
 */
interface CoreSettingsDeviceInfo {
    versionName: string;
    versionCode: number;
    compilationTime: number;
    lastCommit: string;
    siteUrl?: string;
    isPrefixedUrl?: boolean;
    siteId?: string;
    siteVersion?: string;
    fileSystemRoot?: string;
    userAgent?: string;
    deviceOs?: string;
    browserLanguage?: string;
    currentLanguage?: string;
    locationHref?: string;
    deviceType: string;
    screen?: string;
    networkStatus: string;
    wifiConnection: string;
    cordovaVersion?: string;
    platform?: string;
    osVersion?: string;
    model?: string;
    uuid?: string;
    pushId?: string;
    localNotifAvailable: string;
    encryptedPushSupported?: boolean;
}

/**
 * Page that displays the device information.
 */
@Component({
    selector: 'page-core-app-settings-deviceinfo',
    templateUrl: 'deviceinfo.html',
    styleUrls: ['deviceinfo.scss'],
})
export class CoreSettingsDeviceInfoPage implements OnDestroy {

    deviceInfo: CoreSettingsDeviceInfo;
    deviceOsTranslated?: string;
    currentLangName?: string;
    fsClickable = false;
    showDevOptions = false;
    displaySiteUrl = false;
    protected devOptionsClickCounter = 0;
    protected devOptionsForced = false;
    protected devOptionsClickTimeout?: number;

    protected onlineObserver?: Subscription;

    constructor() {
        const sitesProvider = CoreSites.instance;
        const device = Device.instance;
        const translate = Translate.instance;
        const navigator = window.navigator;

        this.deviceInfo = {
            versionName: CoreConstants.CONFIG.versionname,
            versionCode: CoreConstants.CONFIG.versioncode,
            compilationTime: CoreConstants.BUILD.compilationTime || 0,
            lastCommit: CoreConstants.BUILD.lastCommitHash || '',
            networkStatus: CoreNetwork.isOnline() ? 'online' : 'offline',
            wifiConnection: CoreNetwork.isWifi() ? 'yes' : 'no',
            localNotifAvailable: CoreLocalNotifications.isPluginAvailable() ? 'yes' : 'no',
            pushId: CorePushNotifications.getPushId(),
            deviceType: '',
        };

        if (window.location && window.location.href) {
            const url = window.location.href;
            this.deviceInfo.locationHref = url.indexOf('#') > 0 ? url.substring(0, url.indexOf('#')) : url;
        }

        if (window.screen) {
            this.deviceInfo.screen = window.innerWidth + 'x' + window.innerHeight +
                ' (' + window.screen.width + 'x' + window.screen.height + ')';
        }

        if (CorePlatform.isMobile()) {
            this.deviceInfo.deviceType = CorePlatform.is('tablet') ? 'tablet' : 'phone';
            if (CorePlatform.isAndroid()) {
                this.deviceInfo.deviceOs = 'android';
                this.deviceOsTranslated = 'Android';
            } else if (CorePlatform.isIOS()) {
                this.deviceInfo.deviceOs = 'ios';
                this.deviceOsTranslated = 'iOS';
            } else {
                const matches = navigator.userAgent.match(/\(([^)]*)\)/);
                if (matches && matches.length > 1) {
                    this.deviceInfo.deviceOs = matches[1];
                    this.deviceOsTranslated = matches[1];
                } else {
                    this.deviceInfo.deviceOs = 'unknown';
                    this.deviceOsTranslated = translate.instant('core.unknown');
                }
            }
        } else {
            this.deviceInfo.deviceType = 'browser';
            const matches = navigator.userAgent.match(/\(([^)]*)\)/);
            if (matches && matches.length > 1) {
                this.deviceInfo.deviceOs = matches[1];
                this.deviceOsTranslated = matches[1];
            } else {
                this.deviceInfo.deviceOs = 'unknown';
                this.deviceOsTranslated = translate.instant('core.unknown');
            }
        }

        if (navigator) {
            if (navigator.userAgent) {
                this.deviceInfo.userAgent = navigator.userAgent;
            }

            if (navigator.language) {
                this.deviceInfo.browserLanguage = navigator.language;
            }
        }

        if (device) {
            if (device.cordova) {
                this.deviceInfo.cordovaVersion = device.cordova;
            }
            if (device.platform) {
                this.deviceInfo.platform = device.platform;
            }
            if (device.version) {
                this.deviceInfo.osVersion = device.version;
            }
            if (device.model) {
                this.deviceInfo.model = device.model;
            }
            if (device.uuid) {
                this.deviceInfo.uuid = device.uuid;
            }
        }

        const currentSite = sitesProvider.getCurrentSite();
        this.deviceInfo.siteId = currentSite?.getId();
        this.deviceInfo.siteVersion = currentSite?.getInfo()?.release;

        // Refresh online status when changes.
        this.onlineObserver = CoreNetwork.onChange().subscribe(() => {
            // Execute the callback in the Angular zone, so change detection doesn't stop working.
            NgZone.run(() => {
                this.deviceInfo.networkStatus = CoreNetwork.isOnline() ? 'online' : 'offline';
            });
        });

        this.asyncInit();
    }

    /**
     * Async part of the constructor.
     */
    protected async asyncInit(): Promise<void> {
        const sitesProvider = CoreSites.instance;
        const fileProvider = CoreFile.instance;

        const lang = await CoreLang.getCurrentLanguage();
        this.deviceInfo.currentLanguage = lang;
        this.currentLangName = CoreConstants.CONFIG.languages[lang];

        const currentSite = sitesProvider.getCurrentSite();
        const isSingleFixedSite = await CoreLoginHelper.isSingleFixedSite();
        const sites = await CoreLoginHelper.getAvailableSites();
        const firstUrl = isSingleFixedSite && sites[0].url;

        this.deviceInfo.siteUrl = currentSite?.getURL() || firstUrl || undefined;
        this.deviceInfo.isPrefixedUrl = !!sites.length;
        this.displaySiteUrl = !!this.deviceInfo.siteUrl &&
            (currentSite ?? CoreSitesFactory.makeUnauthenticatedSite(this.deviceInfo.siteUrl)).shouldDisplayInformativeLinks();

        if (fileProvider.isAvailable()) {
            const basepath = await fileProvider.getBasePath();
            this.deviceInfo.fileSystemRoot = basepath;
            this.fsClickable = fileProvider.usesHTMLAPI();
        }

        const showDevOptionsOnConfig = await CoreConfig.get('showDevOptions', 0);
        this.devOptionsForced = CoreConstants.BUILD.isDevelopment || CoreConstants.BUILD.isTesting;
        this.showDevOptions = this.devOptionsForced || showDevOptionsOnConfig == 1;

        const publicKey = this.deviceInfo.pushId ?
            await CoreUtils.ignoreErrors(CorePushNotifications.getPublicKey()) :
            undefined;
        this.deviceInfo.encryptedPushSupported = publicKey !== undefined;
    }

    /**
     * Copies device info into the clipboard.
     */
    copyInfo(): void {
        CoreUtils.copyToClipboard(JSON.stringify(this.deviceInfo));
    }

    /**
     * Copies device info item into the clipboard.
     *
     * @param e Event.
     */
    copyItemInfo(e: Event): void {
        const el = <Element>e.target;
        const text = el?.closest('ion-item')?.textContent?.trim();

        text && CoreUtils.copyToClipboard(text);
    }

    /**
     * Page destroyed.
     */
    ngOnDestroy(): void {
        this.onlineObserver && this.onlineObserver.unsubscribe();
    }

    /**
     * 5 clicks will enable dev options.
     */
    async enableDevOptions(): Promise<void> {
        if (this.devOptionsForced) {
            return;
        }

        clearTimeout(this.devOptionsClickTimeout);
        this.devOptionsClickCounter++;

        if (this.devOptionsClickCounter == 5) {
            if (!this.showDevOptions) {
                this.showDevOptions = true;
                await CoreConfig.set('showDevOptions', 1);

                CoreDomUtils.showToast('core.settings.youradev', true);
            } else {
                this.showDevOptions = false;
                await CoreConfig.delete('showDevOptions');
            }

            this.devOptionsClickCounter = 0;

            return;
        }

        this.devOptionsClickTimeout = window.setTimeout(() => {
            this.devOptionsClickTimeout = undefined;
            this.devOptionsClickCounter = 0;
        }, 500);
    }

    /**
     * Navigate to dev options.
     */
    gotoDevOptions(): void {
        CoreNavigator.navigate('dev');
    }

}
<ion-header>
    <ion-toolbar>
        <ion-buttons slot="start">
            <ion-back-button [text]="'core.back' | translate" />
        </ion-buttons>
        <ion-title>
            <h1>
                {{ 'core.settings.deviceinfo' | translate }}
            </h1>
        </ion-title>
        <ion-buttons slot="end">
            <ion-button fill="clear" (click)="copyInfo()" [attr.aria-label]="'core.settings.copyinfo' | translate">
                <ion-icon slot="icon-only" name="fas-clipboard" aria-hidden="true" />
            </ion-button>
        </ion-buttons>
    </ion-toolbar>
</ion-header>

<ion-content>
    <ion-list class="list-item-limited-width">
        <ion-item *ngIf="showDevOptions" [detail]="true" (click)="gotoDevOptions()">
            <ion-icon name="fas-terminal" slot="start" aria-hidden="true" />
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.developeroptions' | translate }}</p>
            </ion-label>
        </ion-item>
        <ion-item (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.appversion' | translate}}</p>
                <p>{{ deviceInfo.versionName }} ({{ deviceInfo.versionCode }})</p>
            </ion-label>
        </ion-item>
        <ion-item (longPress)="copyItemInfo($event)" (click)="enableDevOptions()">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.compilationinfo' | translate }}</p>
                <p *ngIf="deviceInfo.compilationTime">{{ deviceInfo.compilationTime | coreFormatDate: "LLL Z": false }}</p>
                <p *ngIf="deviceInfo.lastCommit">{{ deviceInfo.lastCommit }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.siteUrl" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.siteinfo' | translate }}<ng-container *ngIf="deviceInfo.isPrefixedUrl">
                        *</ng-container>
                </p>
                <p *ngIf="displaySiteUrl"><a [href]="deviceInfo.siteUrl" core-link auto-login="yes">{{ deviceInfo.siteUrl }}</a></p>
                <p *ngIf="deviceInfo.siteVersion">{{ deviceInfo.siteVersion }}</p>
                <p *ngIf="deviceInfo.siteId">{{ deviceInfo.siteId }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.fileSystemRoot" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.filesystemroot' | translate }}</p>
                <p>
                    <a *ngIf="fsClickable" [href]="deviceInfo.fileSystemRoot" core-link auto-login="no">
                        {{ deviceInfo.fileSystemRoot }}
                    </a>
                </p>
                <p *ngIf="!fsClickable">{{ deviceInfo.fileSystemRoot }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.userAgent" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.navigatoruseragent' | translate }}</p>
                <p>{{ deviceInfo.userAgent }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.browserLanguage" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.navigatorlanguage' | translate }}</p>
                <p>{{ deviceInfo.browserLanguage }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.currentLanguage" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.currentlanguage' | translate }}</p>
                <p>{{ currentLangName }} ({{ deviceInfo.currentLanguage }})</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.locationHref" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.locationhref' | translate }}</p>
                <p>{{ deviceInfo.locationHref }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.deviceType" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.displayformat' | translate }}</p>
                <p>{{ 'core.' + deviceInfo.deviceType | translate }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.deviceOs && deviceOsTranslated" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.deviceos' | translate}}</p>
                <p>{{ deviceOsTranslated }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.screen" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.screen' | translate }}</p>
                <p>{{ deviceInfo.screen }}</p>
            </ion-label>
        </ion-item>
        <ion-item (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.networkstatus' | translate}}</p>
                <p>{{ 'core.' + deviceInfo.networkStatus | translate }}</p>
            </ion-label>
        </ion-item>
        <ion-item (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.wificonnection' | translate}}</p>
                <p>{{ 'core.' + deviceInfo.wifiConnection | translate }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.cordovaVersion" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.cordovaversion' | translate }}</p>
                <p>{{ deviceInfo.cordovaVersion }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.platform" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.cordovadeviceplatform' | translate }}</p>
                <p>{{ deviceInfo.platform }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.osVersion" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.cordovadeviceosversion' | translate }}</p>
                <p>{{ deviceInfo.osVersion }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.model" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.cordovadevicemodel' | translate}}</p>
                <p>{{ deviceInfo.model }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.uuid" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.cordovadeviceuuid' | translate}}</p>
                <p>{{ deviceInfo.uuid }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.pushId" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.pushid' | translate }}</p>
                <p>{{ deviceInfo.pushId }}</p>
            </ion-label>
        </ion-item>
        <ion-item *ngIf="deviceInfo.pushId" (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.encryptedpushsupported' | translate }}</p>
                <p *ngIf="!deviceInfo.encryptedPushSupported">{{ 'core.no' | translate }}</p>
                <p *ngIf="deviceInfo.encryptedPushSupported">{{ 'core.yes' | translate }}</p>
            </ion-label>
        </ion-item>
        <ion-item (longPress)="copyItemInfo($event)">
            <ion-label class="ion-text-wrap">
                <p class="item-heading">{{ 'core.settings.localnotifavailable' | translate }}</p>
                <p>{{ 'core.' + deviceInfo.localNotifAvailable | translate }}</p>
            </ion-label>
        </ion-item>
    </ion-list>
</ion-content>
